import React from 'react';
import { Button, Form } from 'semantic-ui-react';

const TournamentFormComponent = () => {

    return <Form>
        <Form.Group widths='equal'>
            <Form.Field
                label = 'Percent Cooperate Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
            <Form.Field
                label = 'Percent Defect Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />            
            <Form.Field
                label = 'Percent CopyCat Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
            <Form.Field
                label = 'Percent Grudge Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
            <Form.Field
                label = 'Percent Custom Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
        </Form.Group>
        <Button type='submit'>Submit</Button>
    </Form>

}

export default TournamentFormComponent;
